import React from 'react'

export default function ExpList({expsToShow}, handle) {
    return (
        <div>
            {expsToShow.map((d) => (
                            <div className="item"> 
                                <a href={d.link} target="_blank"><img src={d.img} alt={d.desc}></img></a>
                                <div className="overlay">
                                    <h3 id="name">{d.title}</h3>
                                </div>
                            </div>
                        ))}
                        <button onClick={handle}>Load more</button>
        </div>
    )
}
